import React from 'react';
import Navbar from '../navSection/Navbar';
import Map from '../component/Map';
import HouseOutlinedIcon from '@mui/icons-material/HouseOutlined';
import Cards from '../component/Cards';
import { Link } from 'react-router-dom';
import './homePage.css';

const data = [
  {
    name: 'jolof rice',
    desc: 'nigeria jolof',
    price: 1200,
    _id: 'kzd',
    kitchenName: 'iyah-dolof kitchen',
    kitchenRating: 3.5,
    verified: true,
    physicalAddress: '30 udeji street lagos island',
    status: 'available',
    content: ['2 portions of rice', '1 chicken lap'],
    img: 'https://cdn.filestackcontent.com/5ngAPL80SuCvpsEb7S2f',
  },
  {
    name: 'amala and ewedu',
    desc: 'hot delicious amala and ewedu',
    content: [
      '1 chicken lap',
      'a bow of soup',
      '2 wraps of amala',
      '4 pieces of beef',
    ],
    price: 700,
    _id: 'kzd28',
    kitchenName: 'iyah-dolof kitchen',
    kitchenRating: 1.5,
    verified: true,
    physicalAddress: '30 udeji street lagos island',
    status: 'available',
    img: 'https://www.shutterstock.com/image-photo/top-view-meal-nigerian-amala-600nw-1386416945.jpg',
  },
];



function HomePage() {
  return (
    <div>
      <Navbar />
      <Map />
      <div className="my-3 d-flex justify-content-center">
        {' '}
        <h3 className="border-bottom border-secondary">
          We diliver to your door-step
          <HouseOutlinedIcon className="fs-1 text-success" />
        </h3>
      </div>
      <div className="d-flex gap-3 justify-content-center align-items-center my-3">
        {data.map((item) => (
          <Link key={item._id} className="box">
            <Cards item={item} />
          </Link>
        ))}
      </div>
      <div className="d-flex justify-content-center align-items-center">
        <div
          className="d-flex justify-content-center align-items-center flex-column p-3 "
          style={{ borderLeft: '1px solid green' }}
        >
          <ul>
            <li>Budget-friendly options for every customer</li>
            <li>Guaranteed 100% delivery success rate</li>
            <li>Wide variety of cuisines to satisfy diverse tastes</li>
            <li>Efficient and timely delivery services</li>
            <li>User-friendly mobile app for seamless ordering</li>
          </ul>
          <div></div>
        </div>
      </div>
    </div>
  );
}

export default HomePage;
